"use strict";(self.webpackChunkwos_wiki=self.webpackChunkwos_wiki||[]).push([[886],{4131:e=>{e.exports=JSON.parse('{"tag":{"label":"Electrical","permalink":"/Pilot.lua-Luau-LSP/docs/tags/electrical","allTagsPath":"/Pilot.lua-Luau-LSP/docs/tags","count":68,"items":[{"id":"Objects/AirSupply","title":"AirSupply","description":"Generates a 300 stud radius oxygen bubble when powered on. Very important part for space ships, as it acts as the oxygen supply for the ship.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/AirSupply"},{"id":"Programmable Objects/ARController","title":"ARController","description":"Methods","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/ARController"},{"id":"Programmable Objects/Assembler","title":"Assembler","description":"Assembles items as configured when the structure is supplied with the required power and resources.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/Assembler"},{"id":"Objects/AutomaticLaser","title":"AutomaticLaser","description":"Fires a continous set of lasers when powered. Like most other energy/thermal weapons, it generates heat when powered. It generates up to 65 degrees of heat, meaning you will need atleast 2 or 3 coolers.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/AutomaticLaser"},{"id":"Objects/Beacon","title":"Beacon","description":"Creates a small beacon of light when powered.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Beacon"},{"id":"Objects/Boombox","title":"Boombox","description":"Must be powered in order to play music. When clicked, it will toggle playing music and will play the song id you give it.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Boombox"},{"id":"Objects/BurnerGenerator","title":"BurnerGenerator","description":"Creates electricity when fueled with coal.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/BurnerGenerator"},{"id":"Objects/CloningBay","title":"CloningBay","description":"Similar to a SpawnPoint, but allows players to respawn at the location from far away even at another region.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/CloningBay"},{"id":"Objects/CombustionTurbine","title":"CombustionTurbine","description":"Creates electricity when fueled by gasoline.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/CombustionTurbine"},{"id":"Objects/ConveyorBelt","title":"ConveyorBelt","description":"Moves objects ontop of it towards the front of the conveyor belt. Only moves when powered and anchored or attached to the ground.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/ConveyorBelt"},{"id":"Objects/Cooler","title":"Cooler","description":"Cools down the heat around a space when supplied with power.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Cooler"},{"id":"Objects/DarkConverter","title":"DarkConverter","description":"Converts attached dark matter bins into energy. 1 unit of dark matter is equal to 1000 watts of power. However, this generates a ton of heat in the process, nearly up to 200 degrees when activated. This means you will need about 10 coolers to avoid combustion.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/DarkConverter"},{"id":"Objects/DarkReactor","title":"DarkReactor","description":"Generates Dark Matter when powered and near a black hole.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/DarkReactor"},{"id":"Objects/Diode","title":"Diode","description":"Allows electrical objects to interact with each other when connected by the diode, but only in its direction as depicted by an arrow.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Diode"},{"id":"Objects/ElectricFence","title":"ElectricFence","description":"A special version of the fence which damages upon contact.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/ElectricFence"},{"id":"Objects/Electromagnet","title":"Electromagnet","description":"A powerful magnet.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Electromagnet"},{"id":"Programmable Objects/EnergyShield","title":"EnergyShield","description":"Creates a bubble made of energy that protects it from energy based weapons such as Lasers and Plasma Cannons.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/EnergyShield"},{"id":"Objects/Extractor","title":"Extractor","description":"Extracts and harvests materials from connected terrain such as mountains and ore deposits.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Extractor"},{"id":"Objects/FloatDevice","title":"FloatDevice","description":"Defies gravity when powered. Allows for vehicles such as space ships to float.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/FloatDevice"},{"id":"Objects/Freezer","title":"Freezer","description":"Turns attached water bins into ice when powered.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Freezer"},{"id":"Objects/Generator","title":"Generator","description":"Creates energy from rotation.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Generator"},{"id":"Objects/GravityGenerator","title":"GravityGenerator","description":"Generates an artificial gravity field when powered on. The gravity field only affects players, not individual parts. The amount of gravity can also be configureed, but the more gravity the higher amount of power needed. Only works in space, not inside planets.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/GravityGenerator"},{"id":"Programmable Objects/Gyro","title":"Gyro","description":"Stabilizes vehicles and structures by pointing upwards. Useful for mechs or orientating structures to the correct rotation. The gyro can also be configured to seek objects and players.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/Gyro"},{"id":"Objects/Hatch","title":"Hatch","description":"Acts as a chute when active/gray, but when black or inactive it acts as a normal object.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Hatch"},{"id":"Objects/Heater","title":"Heater","description":"Generated heat when powered by electricity. Glows red hot while functioning.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Heater"},{"id":"Objects/Heatshield","title":"Heatshield","description":"Generates a 300 stud radius area that protects all players and only players within the vicinity from temperature damage.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Heatshield"},{"id":"Objects/Hologram","title":"Hologram","description":"Using our brand new Multi-Dimensional Holographic Projection Technology\u2122 you are able to create a stationary clone with only the ID of the user provided!.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Hologram"},{"id":"Objects/Hydroponic","title":"Hydroponic","description":"Grows grass and wood from water, turning attached water bins into either wood, sticks or grass. Incredibly useful for space bases or bases in areas devoid of life.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Hydroponic"},{"id":"Objects/IonRocket","title":"IonRocket","description":"An IonRocket allows space flight. When powered, it will propel force dependent on the Propulsion setting, which you can configure with the hammer tool.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/IonRocket"},{"id":"Objects/Kiln","title":"Kiln","description":"Turns attached sand bins into glass.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Kiln"},{"id":"Objects/Laser","title":"Laser","description":"Fires a concentraded beam of energy when powered, which can be used to damage and set objects on fire.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Laser"},{"id":"Programmable Objects/Light","title":"Light","description":"Emits light when powered with electricity. Can be colored in different ways, changing the light color","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/Light"},{"id":"Objects/LightBridge","title":"LightBridge","description":"Fires a beam of solid light that can be walked on.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/LightBridge"},{"id":"Programmable Objects/LightTube","title":"LightTube","description":"Emits light when powered with electricity. Can be colored in different ways, changing the light color","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/LightTube"},{"id":"Objects/Melter","title":"Melter","description":"Turns attached ice bins into water when powered.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Melter"},{"id":"Objects/MiningLaser","title":"MiningLaser","description":"Fires a concentraded beam of energy when powered, which is used to mine objects such as asteroids, mountains and ore deposits.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/MiningLaser"},{"id":"Programmable Objects/Modem","title":"Modem","description":"A computer networking object that allows you to send, save and get messages cross-region.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/Modem"},{"id":"Objects/Motor","title":"Motor","description":"Spins objects attached to the hinge at the front when powered.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Motor"},{"id":"Objects/Obelisk","title":"Obelisk","description":"An object designed to attract aliens to the region. Emits an ominous noise when powered.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Obelisk"},{"id":"Objects/Pulverizer","title":"Pulverizer","description":"Turns attached stone bins into sand. Once powered, the pulverizer will pulverize any stone bins attached into sand.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Pulverizer"},{"id":"Objects/Pump","title":"Pump","description":"Pumps liquid from the environment into attached containers. For example, a pump located in the ocean will pump water when powered.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Pump"},{"id":"Objects/Railgun","title":"Railgun","description":"Fires a piercing rail at high speeds. A long range weapon. Requires rails and electricity for ammo. Damage increases for every 10 studs of length.pierce if the hit part is destroyed. Must be at least have a width and height of 6 and at least a length of 30 to function.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Railgun"},{"id":"Objects/Refinery","title":"Refinery","description":"Turns oil into Petroleum and Gasoline.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Refinery"},{"id":"Objects/RegionCloaker","title":"RegionCloaker","description":"Hides a certain region from players, making the coordinates not appear on their screen.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/RegionCloaker"},{"id":"Objects/Rocket","title":"Rocket","description":"A propulsion device that consumes gasoline.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Rocket"},{"id":"Objects/RTG","title":"RTG","description":"Creates electricity from decaying radioactive elements.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/RTG"},{"id":"Objects/Scrapper","title":"Scrapper","description":"Scraps solid items provided through a dispenser into their crafting components when powered. It also destroys unanchored single parts when touched.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Scrapper"},{"id":"Programmable Objects/Screen","title":"Screen","description":"A programmable object capable of showing text, buttons and images on an LED display. Very useful for creating custom programmable interfaces.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/Screen"},{"id":"Programmable Objects/Servo","title":"Servo","description":"Spins objects attached to the hinge at the front when powered, to set angles.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/Servo"},{"id":"Objects/SolarPanel","title":"SolarPanel","description":"Generates electricity using solar energy from a local star.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/SolarPanel"},{"id":"Objects/SolarScoop","title":"SolarScoop","description":"Extracts materials from a star when powered and pointed at a star.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/SolarScoop"},{"id":"Programmable Objects/Speaker","title":"Speaker","description":"Plays audio of length up to 5 seconds, unless it is powered in which case it can play a full audio.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/Speaker"},{"id":"Programmable Objects/Spotlight","title":"Spotlight","description":"Emits light in a cone when powered with electricity. Color emition can be changed by coloring it.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/Spotlight"},{"id":"Programmable Objects/StarMap","title":"StarMap","description":"Shows your current location in the universe and other nearby stars and celestial bodies.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/StarMap"},{"id":"Objects/StasisField","title":"StasisField","description":"Creates a 500 stud radius field that prevents any parts or objects around it from being dragged.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/StasisField"},{"id":"Programmable Objects/SteamTurbine","title":"SteamTurbine","description":"Creates electricity when fueled by 2 boilers.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/SteamTurbine"},{"id":"Objects/StudAligner","title":"StudAligner","description":"An integral part for creating vehicles, it aligns them to be viable for saving.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/StudAligner"},{"id":"Objects/Switch","title":"Switch","description":"Acts as a wire when active/green, but when black or inactive it acts as a normal object. Must use a polysilicon to switch for trigger events.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Switch"},{"id":"Programmable Objects/Telescope","title":"Telescope","description":"A device that allows you to look at celestial objects and regions of space from a far away distance.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/Telescope"},{"id":"Objects/Thruster","title":"Thruster","description":"A device that creates forward propulsion depending on its size when powered.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Thruster"},{"id":"Programmable Objects/TouchScreen","title":"TouchScreen","description":"A Screen, but with capabilities of handling player mouse input.","permalink":"/Pilot.lua-Luau-LSP/docs/Programmable Objects/TouchScreen"},{"id":"Objects/Transformer","title":"Transformer","description":"Sends continuous trigger signals every second when powered.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Transformer"},{"id":"Objects/Treads","title":"Treads","description":"When touching in contact with a solid surface, it will move forward. Must be connected to an engine or motor similar to a drivebox to function.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Treads"},{"id":"Objects/TriggerSwitch","title":"TriggerSwitch","description":"Acts as a triggerwire when active/green, but when black or inactive it acts as a normal object.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/TriggerSwitch"},{"id":"Objects/Valve","title":"Valve","description":"Acts as a pipe when active/gray, but when black or inactive it acts as a normal object.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Valve"},{"id":"Objects/WaterCooler","title":"WaterCooler","description":"Generates cold temperatures when given a supply of water. Useful for cooling down devices, and does not require power. Performs the same amount of cooling that five coolers would.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/WaterCooler"},{"id":"Objects/Wire","title":"Wire","description":"Allows electrical objects to interact with each other when connected by wires. For example, attaching a wire between a powercell and a light will allow electricity to move through the wire, allowing the light to function causing a source of light to be created.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/Wire"},{"id":"Objects/ZapWire","title":"ZapWire","description":"Allows electrical objects to interact with each other when connected by wires.","permalink":"/Pilot.lua-Luau-LSP/docs/Objects/ZapWire"}],"unlisted":false}}')}}]);